{
  "name": "UBX-NAV-TIMETRUSTED",
  "class_id": "0x01",
  "message_id": "0x64",
  "description": "External trusted time information. This message contains information about external trusted time received via assistance data (UBX-MGA-INI-TIME_UTC or UBX-MGA-INI-TIME_GNSS).",
  "message_type": "output",
  "payload": {
    "length": {
      "fixed": 40
    },
    "fields": [
      {
        "name": "version",
        "byte_offset": 0,
        "data_type": "U1",
        "description": "Message version (0x01 for this version)"
      },
      {
        "name": "refSys",
        "byte_offset": 1,
        "data_type": "U1",
        "description": "Reference time system (all the GNSS system supported by UBX-MGA-INI-TIME_GNSS except Glonass)\n• 0: None\n• 1: GPS Time\n• 2: Galileo System Time (GST)\n• 3: Beidou System Time (BDT)\n• 15: NavIC System Time"
      },
      {
        "name": "valid",
        "byte_offset": 2,
        "data_type": "X1",
        "description": "Validity Flags",
        "bitfield": {
          "bits": [
            {
              "name": "trustedTime",
              "bit_start": 0,
              "bit_end": 0,
              "description": "1 = Valid initial and propagated trusted time (iniWno, iniTow, finiTow, iniTAcc, propWno, propTow, fPropTow and propTAcc)"
            },
            {
              "name": "deltaTimeValid",
              "bit_start": 1,
              "bit_end": 1,
              "description": "1 = Valid delta time (deltas and deltaMs) between current estimated time and the propagated trusted time"
            }
          ]
        }
      },
      {
        "name": "reserved0",
        "byte_offset": 3,
        "data_type": "U1",
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "iTOW",
        "byte_offset": 4,
        "data_type": "U4",
        "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details.",
        "unit": "ms"
      },
      {
        "name": "iniWno",
        "byte_offset": 8,
        "data_type": "U2",
        "description": "Initial week number"
      },
      {
        "name": "propWno",
        "byte_offset": 10,
        "data_type": "U2",
        "description": "Week number propagating the initial trusted time"
      },
      {
        "name": "iniTow",
        "byte_offset": 12,
        "data_type": "U4",
        "description": "Initial time of week",
        "unit": "ms"
      },
      {
        "name": "propTow",
        "byte_offset": 16,
        "data_type": "U4",
        "description": "Time of week propagating the initial trusted time",
        "unit": "ms"
      },
      {
        "name": "iniTAcc",
        "byte_offset": 20,
        "data_type": "U4",
        "description": "Initial Time Accuracy Estimate",
        "unit": "ms"
      },
      {
        "name": "propTAcc",
        "byte_offset": 24,
        "data_type": "U4",
        "description": "Propagated Time Accuracy Estimate",
        "unit": "ms"
      },
      {
        "name": "deltas",
        "byte_offset": 28,
        "data_type": "I4",
        "description": "Integer seconds of delta time (current estimated time minus propagated trusted time)",
        "unit": "S"
      },
      {
        "name": "deltaMs",
        "byte_offset": 32,
        "data_type": "I4",
        "description": "Integer milliseconds of delta time (current estimated time minus propagated trusted time)",
        "unit": "ms"
      },
      {
        "name": "reserved1",
        "byte_offset": 36,
        "data_type": {
          "array_of": "U1",
          "count": 4
        },
        "description": "Reserved",
        "reserved": true
      }
    ]
  }
}

